import React, { useEffect, useState, useCallback } from "react";
import axios from "axios";
import { userBooking } from "../actions/BookingAction";

function PrintScreen(props) {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:5000/api/booking/bookinglist").then((res) => {
      console.log(res);
      setPosts(res.data);
    });
  }, []);

  return (
    <div>
      <h1>Thank You for registering</h1>
      <p>PLease don't forget to carry your photo id and print out copy </p>
      <button>Print Copy</button>

      <div>
        <table className="table">
          <thead>
            <tr>
              <th>ID</th>
              {/* <th>USER</th> */}

              <th>Name</th>
              <th>Mobile Number</th>
              <th>Birth Date</th>
              <th>Age</th>
              <th>Photo ID Proof Name</th>
              <th>Photo ID Proof Number</th>
              <th>Any Dieases</th>
              <th>Vaccine Center</th>
            </tr>
          </thead>
          <tbody>
            {posts.map((post) => (
              <li key={post._id}>
                <td>{post._id}</td>
                <td>{post.name}</td>
                <td>{post.mobilenumber}</td>
                <td>{post.birthdate}</td>
                <td>{post.age}</td>
                <td>{post.photoidproof}</td>
                <td>{post.idproofnumber}</td>
                <td>{post.sideinfo}</td>
                <td>{post.hoslocation}</td>
              </li>
            ))}
          </tbody>
        </table>
      </div>

      {/* <ul>
        {posts.map((post) => (
          <li key={post._id}>
            <td>{post._id}</td>
            <td>{post.name}</td>
          </li>
        ))}
      </ul> */}
    </div>
  );
}

export default PrintScreen;
